import {React} from 'react';
import logo from '../logo.png';
import {Link} from 'react-router-dom'
import '../Styles/Navbar.css';
import Dropdown from './Dropdown.jsx'

function Navbar() {
    return (
        <div>
            <nav>
                <img src={logo} alt="logo" class="logoNav" />
                <div class="empty"></div>
                <div className="buttons-holder">
                    <Link to="/" id="homeButton"><button>Home</button></Link>
                    <button class="reg-button">Graph</button>
                    <button class="reg-button">Predict</button>
                </div>

                <svg id="hamburger" xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" className="bi bi-list" viewBox="0 0 16 16">
                    <path fill-rule="evenodd" d="M2.5 12a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5zm0-4a.5.5 0 0 1 .5-.5h10a.5.5 0 0 1 0 1H3a.5.5 0 0 1-.5-.5z" />
                </svg>

            </nav>

            <Dropdown />
        </div>


    )
}

export default Navbar;
